package com.tnsif.operations;

public class Arithematic {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x=100;
		int y=20;
		char z='d';
		System.out.println((x + z)); 
		System.out.println((x - y));
		System.out.println(x * y); 
		System.out.println(x / y);
		System.out.println(x % y);
		 
		System.out.println(++y);
		System.out.println(--y);
		System.out.println(y++);
		System.out.println(y--);


	}

}
